{"$content":[{"ID":"main_011_001_dialog_english##_00_000","SpeakerName":"Crushfang","SpeakerAssetName":"CharacterName/t0033","IconName":"t0033s5_serious","IconLocate":2,"Text":"So this is the Kingdom of Sun's genius strategist that the princess told me about? Heard you're Nikola's lone disciple.","sfxName":"t0033_story_004_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_00_001","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Greetings. Indeed, my master is...","sfxName":"h0134_story_025","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_00_002","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"--Hmpf, genius? We'll see about that...","sfxName":"t0032_story_015","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_01_000","SpeakerName":"Crushfang","SpeakerAssetName":"CharacterName/t0033","IconName":"t0033s5_anger","IconLocate":2,"Text":"Dagger! Manners!","sfxName":"t0033_story_005","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_000","SpeakerName":"Crushfang","SpeakerAssetName":"CharacterName/t0033","IconName":"t0033s5_serious","IconLocate":2,"Text":"Princess, the Bears chose to assist you for one purpose; in hopes that after the war finishes,
","sfxName":"t0033_story_018_ve1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_001","SpeakerName":"Crushfang","SpeakerAssetName":"CharacterName/t0033","IconName":"t0033s5_serious","IconLocate":2,"Text":"Bears can return to their previous lifestyle, one where illegal miners don't bother us anymore.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_002","SpeakerName":"Angelia","SpeakerAssetName":"CharacterName/h0021","IconName":"h0021s4_serious","IconLocate":2,"Text":"Chieftain Crushfang, I understand your concerns. But I have witnessed Sir Hyde's strategic capabilities first-hand.","sfxName":"h0021_story_023","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_003","SpeakerName":"Angelia","SpeakerAssetName":"CharacterName/h0021","IconName":"h0021s4_serious","IconLocate":2,"Text":"I can assure you that he will lead us to victory against Theodore.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_004","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"Hell no, Angelia. You understand nothing! War is all about life and death.","sfxName":"t0032_story_019_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_005","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"Asking us to hand our lives to this total stranger, a bit sloppy, don't you think?","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_02_006","SpeakerName":"Dylan","SpeakerAssetName":"CharacterName/h0022","IconName":"h0022s4_serious","IconLocate":2,"Text":"I agree as well.","sfxName":"h0022_story_011","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_03_000","SpeakerName":"Angelia","SpeakerAssetName":"CharacterName/h0021","IconName":"h0021s4_surprise","IconLocate":2,"Text":"Colonel Levon!?","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_03_001","SpeakerName":"Dylan","SpeakerAssetName":"CharacterName/h0022","IconName":"h0022s4_serious","IconLocate":2,"Text":"Princess, pardon my intrusion, but war is not child's play. As someone with no actual combat experience, your assurance means little. ","sfxName":"h0022_story_013","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_03_002","SpeakerName":"Dylan","SpeakerAssetName":"CharacterName/h0022","IconName":"h0022s4_serious","IconLocate":2,"Text":"I've worked with Minister Nikola in the past and acknowledged his abilities, but it's a different story with his disciple, whom I'm unfamiliar with.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_03_003","SpeakerName":"Angelia","SpeakerAssetName":"CharacterName/h0021","IconName":"h0021s4_serious","IconLocate":2,"Text":"But...","sfxName":"h0021_story_019","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_03_004","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Alright, chill out, everyone. Don't start an argument over little old me.","sfxName":"h0134_story_004","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_04_000","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Combat experience, eh? You have a point~ If everyone has their doubts, then how about we fight it out?","sfxName":"h0134_story_017","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_05_000","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_happiness","IconLocate":2,"Text":"Hahaha, a fight? With little wimp like you?","sfxName":"t0032_story_005_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_05_001","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"I mean a simulation battle~","sfxName":"h0134_story_019_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_05_002","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"I'll be in charge of the Sunshine Infantry; the Bears by a commander of their choice. We'll have a simple skirmish; winner gets the right to command.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_05_003","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"If you want to test my abilities, this is the simplest way to do so.","sfxName":"h0134_story_002","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_06_000","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"Hmph, we Bears accept the challenge. Chieftain, what do you say?","sfxName":"t0032_story_018_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_06_001","SpeakerName":"Crushfang","SpeakerAssetName":"CharacterName/t0033","IconName":"t0033s5_serious","IconLocate":2,"Text":"Keep things civilized. As long as there are no casualties, I accept.","sfxName":"t0033_story_015_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_06_002","SpeakerName":"Dylan","SpeakerAssetName":"CharacterName/h0022","IconName":"h0022s4_serious","IconLocate":2,"Text":"Agreed.","sfxName":"h0022_story_012","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_06_003","SpeakerName":"Angelia","SpeakerAssetName":"CharacterName/h0021","IconName":"h0021s4_serious","IconLocate":2,"Text":"If Sir Hyde is okay with it, then I accept it too.","sfxName":"h0021_story_023","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_06_004","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Then let us lay down some ground rules~","sfxName":"h0134_story_006","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_07_000","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"So, any movement from Sunshine Infantry?","sfxName":"t0032_story_020","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_07_001","SpeakerName":"Furygrowl","SpeakerAssetName":"CharacterName/t0062c3","IconName":"t0062c3_serious","IconLocate":2,"Text":"Princess is still defending the main camp, but that Hyde guy has taken a small army himself.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_07_002","SpeakerName":"Furygrowl","SpeakerAssetName":"CharacterName/t0062c3","IconName":"t0062c3_serious","IconLocate":2,"Text":"Seems like he is trying to circle around the forest.","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_07_003","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"Planning sneak attack, are ya... ","sfxName":"t0032_story_007","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_07_004","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"We have advantages in both numbers and terrain. Let's go kick that cocky Hyde's human butt!","sfxName":"t0032_story_009","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_08_000","SpeakerName":"Furygrowl","SpeakerAssetName":"CharacterName/t0062c3","IconName":"t0062c3_serious","IconLocate":2,"Text":"Shouldn't we target the princess while their forces are separated? 

All we need to do is take over the main camp or capture the enemy leader, then we win. ","sfxName":"","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_08_001","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"Though it's just simulation battle, I don't want to take the risk of injuring Angelia. As long as we get Hyde, Angelia will know that he is not trustworthy.","sfxName":"t0032_story_017","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_08_002","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"Stop wasting time. Everyone, follow me!","sfxName":"t0032_story_004_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_09_000","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Whew~ Expect no less from the Bears' elite. With all of you here, a weakling strategist like me is no match...","sfxName":"h0134_story_001","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_09_001","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_serious","IconLocate":2,"Text":"All alone, separated from your entire unit. Yet you're still laughing.","sfxName":"t0032_story_015","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_09_002","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"Cut that out, it's irritating me!","sfxName":"t0032_story_007","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_10_000","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"Hold up. Please maintain this formation. Don't press forward.","sfxName":"h0134_story_007","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_10_001","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_embarrass","IconLocate":2,"Text":"What, finally getting scared now?","sfxName":"t0032_story_016_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_10_002","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"No. It's just easier for us to surround you if you don't move.","sfxName":"h0134_story_020","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_000","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_surprise","IconLocate":2,"Text":"What the...?","sfxName":"t0032_story_014","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_001","SpeakerName":"Naya","SpeakerAssetName":"CharacterName/h0018","IconName":"h0018s4_surprise","IconLocate":2,"Text":"Exactly as Hyde said. All we need to do is set up an ambush here; Dagger will barge in and get himself caught in the trap...","sfxName":"h0018_story_006","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_002","SpeakerName":"Sione","SpeakerAssetName":"CharacterName/h0020","IconName":"h0020s4_serious","IconLocate":2,"Text":"It's like he can predict the future. Impressive indeed.","sfxName":"h0020_story_016","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_003","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"Good thing that captain Dagger is the commander in charge. If it was Chieftain Crushfang, things might not have gone so smoothly~","sfxName":"h0134_story_019_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_004","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"Whaddaya just say, you stinkin human!?","sfxName":"t0032_story_024_ver1","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_11_005","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"Fellow soldiers, engage with formation two. Take them out swiftly!","sfxName":"h0134s4_skill_03","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_12_000","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"D-Damn it...","sfxName":"t0032_story_022","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_13_000","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_happiness","IconLocate":2,"Text":"This is what I'm capable of. Captain Dagger, do you acknowledge me now?","sfxName":"h0134_battle_attack_01_1_normal_ver2","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_13_001","SpeakerName":"Dagger","SpeakerAssetName":"CharacterName/t0032","IconName":"t0032s4_anger","IconLocate":2,"Text":"Hmph, a bet's a bet. Go ahead, tell me what you want!","sfxName":"t0032_story_025","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_13_002","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"I want captain Dagger and all Bear soldiers to follow my orders in the future, no matter what.","sfxName":"h0134_story_004","sfxVolume":1.0},{"ID":"main_011_001_dialog_english##_13_003","SpeakerName":"Hyde","SpeakerAssetName":"CharacterName/h0134","IconName":"h0134s4_serious","IconLocate":2,"Text":"Any questions?","sfxName":"","sfxVolume":1.0}]}
